import React, {Component} from 'react';
import Todos from './todos';
class App extends Component {
  state = {
    todos: [
      {
        id: 1, 
        content: "Buy Milk"
      },
      {
        id: 2, 
        content: "Buy food"
      }
    ]
  }
  render(){
    return(
      <div className="todo-app">
        <h3 className="center">This is My ToDo App</h3>
        <Todos />

      </div>
    );
  }
}

export default App;
